<?php

namespace App\Http\Controllers;

//use Anouar\Fpdf\Facades\Fpdf;
use Anouar\Fpdf\Fpdf;
use App\Cliente;
use App\User;
use Illuminate\Http\Request;

class ClienteController extends Controller
{
    protected $imagen = 'data:image/png;base64,';
    public function reportes(){
        return view('cliente.reportes');
    }
    public function generarPDF(){
        $usuarios = User::get();
        $titulos = [
            'Nombres',
            'Apellido Paterno',
            'Apellido Materno',
            'Cuenta'
        ];
        $pdf = new Fpdf();
        $pdf->SetMargins(10, 2, 2);
        $pdf->AddPage();
        //titulos
        foreach ($titulos as $titulo) {
            $pdf->SetFont('Arial', 'B', 12);
            $pdf->Cell(45, 8, $titulo, 1, 0, 'C');
        }
        $pdf->Ln();
        /*datos*/
        $pdf->SetFont('Arial', '', 12);
        foreach ($usuarios as $usuario) {
            $pdf->Cell(45, 7, $usuario->nombres, 1, 0);
            $pdf->Cell(45, 7, $usuario->apellido_paterno, 1, 0);
            $pdf->Cell(45, 7, $usuario->apellido_materno, 1, 0);
            $pdf->Cell(45, 7, $usuario->cuenta, 1, 0);
            $pdf->Ln();
        }
        $pdf->Ln();
        $pdf->Link(10, 80, 20, 20, 'https://plus.google.com/events/c2nh8t5tip3g46jtut1kqo69eic');
        $pdf->Image($this->imagen, 10,80,20,20,'png');
        $pdf->Output();
        exit;
    }
}
